// define a background task to run at 11 kHz, which outputs one value to DAC each interrupt
soundeffect soundplay;
struct sound{
	const unsigned char *wave;
	uint32_t length;
};
typedef struct sound sound_t;
//need to increase to three once i get the sound waves 
	sound_t Sounds[4]={ 
		{lineClear,linelen},
		{blockPlace, blocklen},
		{sinWave,soundlen},
		{NewTetris_WAV,main}
	};


void Timer1A_stop(void);
uint32_t pindex=0;
uint32_t pindex2=0;
uint32_t pindex3=0;
uint32_t pindex4=0;
void playsample(){
	if(soundplay==0){
	DAC_Out(Sounds[soundplay].wave[pindex++]);
	if(pindex>=Sounds[soundplay].length){
		Timer1A_stop();
		pindex=0;
	}
}
	if(soundplay==1){
	DAC_Out(Sounds[soundplay].wave[pindex2++]);
	if(pindex2>=Sounds[soundplay].length){
		Timer1A_stop();
		pindex2=0;
	}
}
	if(soundplay==2){
		DAC_Out(Sounds[soundplay].wave[pindex3++]);
		if(pindex3>=Sounds[soundplay].length){
			Timer1A_stop();
			pindex3=0;
	}
	}
	/*
	if(soundplay==3){
		if(pindex==0 && pindex2==0 && pindex3==0){
		DAC_Out(Sounds[soundplay].wave[pindex4++]);
		if(pindex4>=Sounds[soundplay].length){
			//Timer1A_stop();
			pindex4=0;
	}
	}
}
	*/
}
